import React, { Component } from "react";
export default class CommentBox extends Component {
  constructor(props) {
    super(props);

    this.state = {
      results: [],
      query: ""
    };
  }

  render() {
    return (
      <div>
        <div className="commentBox">
          We created a React div component! WOO!
          <div className="commentList">Yeahhhh I am a CommentList.</div>
          <div className="commentForm">         Party Parrot time. I am a CommentForm.
          </div>
        </div>
      </div>
    );
  }
}
